import React from 'react';
import PropTypes from 'prop-types';

const Name = ({ii, name}) => {     
     const state = {
        demo: ii,
        demo2: name
    }
    const {demo,demo2} = state;
    return (
        <div className="row mt-2">
            <label htmlFor={demo}>{demo2}</label>
            <input id={demo} className="col-9 form-control" />
      </div>
    );
};

Name.propTypes = {
    
};

export default Name;
